import React from "react";
import "./Home.css";
import Cover from "../../img/bg-soap.png";
import Tap from "../../img/ic-tap.png";

const Home = () => {
  return (
    <div className="Home">
      <div className="img">
        <img src={Cover} alt="" />
        <h1>Touch to start your refill process</h1>
        <h1>Let's Reduce and Reuse plastics</h1>
      </div>
      <div className="sen1"></div>
      <div className="button">
        <img src={Tap} alt="" />
      </div>
      <div className="sen2"></div>
    </div>
  );
};

export default Home;
